import {jsPDF} from "jspdf"

var font = '';
var callAddFont = function () {
//@ts-ignore
  this.addFileToVFS('NotoSansHebrew-VariableFont_wdth,wght-normal.ttf', font);
//@ts-ignore
  this.addFont('NotoSansHebrew-VariableFont_wdth,wght-normal.ttf', 'NotoSansHebrew', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])
